import React from 'react'
import { NavLink } from 'react-router-dom'
import SearchBar from '../SearchBar'
import './NavBar.css'

const NavBar = ({ onSearch, randomCharacter, logout }) => {
    return (
        // <nav className='navbar'>
        //     <div className='navbar-container'>
        //         <div className='navbar-logo'>
        //             <h1 className='rick-and-morty'>Rick and morty</h1>
        //         </div>
        //     </div>
        //     <div className='navbar-links'>
        //         <NavLink className={`navlink ${({isActive}) => isActive ? 'active' : 'disabled'}`} to='/home'>Home</NavLink>
        //         <NavLink className={`navlink ${({isActive}) => isActive ? 'active' : 'disabled'}`} to='/about'>About</NavLink>
        //         <SearchBar onSearch={onSearch} randomCharacter={randomCharacter} />
        //         <button className='logout-button' onClick={logout}><i class="fa fa-sign-out" style={{fontSize : '26px'}}></i></button>
        //     </div>
        // </nav>
        <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
            <div class="navbar-brand">
                <h1 class="rick-and-morty">Rick and Morty</h1>
            </div>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
            </button>
                        <SearchBar onSearch={onSearch} randomCharacter={randomCharacter} />
            <div class="collapse navbar-collapse" id="navbarNav">
                <ul class="navbar-nav ml-auto">
                    <li class="nav-item">
                        <NavLink className={`navlink ${({ isActive }) => isActive ? 'active' : 'disabled'}`} to='/home'>Home</NavLink>
                    </li>
                    <li class="nav-item">
                        <NavLink className={`navlink ${({ isActive }) => isActive ? 'active' : 'disabled'}`} to='/about'>About</NavLink>
                    </li>
                    <li class="nav-item">
                    </li>
                    <li class="nav-item">
                        <button class="btn btn-danger logout-button" onClick={logout}>
                            <i class="fa fa-sign-out" style={{ fontSize: '26px' }}></i>
                        </button>
                    </li>
                </ul>
            </div>
        </nav>





    )
}

export default NavBar
